import { useEffect } from 'react'
import './Company.scss'
import { proxy } from '../../../api/proxy'
import { API_ADMIN } from '../../../api/api'

export const CompanyComponent = ({token}) =>{

    useEffect(() =>{
        proxy( API_ADMIN,"GET",{
            headers:{
                Authorization:token
            }
        }).then(res => {
            console.log(res)
        })
    },[])

    return(
        <div className='company'>
            <h2>Company</h2>
            <div className='company__name'>
                <h3>Company Name</h3>
            </div>
            <div className='company__accounts_tab'>
                <h2>Accounts</h2>
                <button>+ Add Account</button>
            </div>
            <div className='company__accounts_container'>
                {}
            </div>
        </div>
    )
}
